pragma solidity ^0.8.0;
// import "VoterLibrary.sol";


library proposalLibrary{

    struct proposal{
        // uint256 proposalId;
        address creator;
        uint8 status;
        string disc;
        address[] voters;
        uint256 startTime;
        uint256 expirationTime;
        uint16 numOfOptions;
        // mapping(address => voter) voterInfo;
        
        // create proposal props
        mapping(string => bool) cand;
        mapping(uint256 => string) candHash;

        // respose proposal props
        mapping(uint => string) result;
        mapping(string => uint) votes;
    }
    // enum ProposalStatus {
    //     IN_PROGRESS,
    //     TALLY,
    //     ENDED
    // }
    // create proposal 
     function createProposal(proposal storage self, uint8 _status, address[] memory _voters, address _creator,
      uint256 _startTime, uint256 _expirationTime, string memory _disc, string[] calldata _cand) internal returns(bool){
                                self.creator = _creator;
                                self.status = _status;
                                self.disc = _disc;
                                self.startTime = _startTime;
                                self.expirationTime = _expirationTime;
                                self.numOfOptions = uint16(_cand.length);
                                for(uint256 i=0;i<_cand.length;i++){
                                    self.cand[_cand[i]] = true;
                                    self.candHash[i+1] =  _cand[i];
                                }
                                for(uint256 i=0;i<_voters.length;i++){
                                    self.voters[i+1] = _voters[i];
                                }

                                return true;

                            }

}
